import React, { useEffect, useState } from "react";
import CloseIcon from "@mui/icons-material/Close";
import { useDispatch } from "react-redux";
import { useSelector } from "react-redux";
import { open } from "../redux/closeSlice";
import { store } from "../store/index";
import "./Body.css";
import {
  closeModal,
  signupModal,
  signindata,
  signupdata,
  checksigninStatus,
  forgetWindow,
} from "../actions/index";

export default function ModelOne({ Title, Signup_close }) {
  const dispatch = useDispatch();
  const [close, setClose] = useState(false);
  const [showwarn, setShowwarn] = useState(false);
  const [email, setEmail] = useState("");
  const [psw, setPsw] = useState("");
  const [show, setShow] = useState(false);
  const [showforget, setShowForget] = useState(false);
  const [showsentemail, setShowsentemail] = useState(false);

  const divStyle = { display: close ? "none" : "block" };
  const warningStyle = { display: showwarn ? "block" : "none" };
  const closeButton = () => {
    setClose(true);
  };
  const format = () => {
    const res = email.includes("@");
    if (res && email && psw) {
      return false;
    } else {
      return true;
    }
  };
  const signin = () => {
    console.log({
      email: { email },
      password: { psw },
    });

    checksigninStatus(dispatch)({ email: email, password: psw });
    setEmail("");
    setPsw("");
    const res = format();
    setShowwarn(res);
  };

  const signup = () => {
    signupdata(dispatch)({ email: email, password: psw });
    setEmail("");
    setPsw("");
    const res = format();
    setShowwarn(res);
  };
  const showpsw = () => {
    console.log("jj");
    setShow(!show);
  };
  return (
    <>
      {showforget ? (
        <>
          {!showsentemail ? (
            <>
              <div className="container_forget" style={divStyle}>
                <div className="title">
                  <h2>Update your password</h2>
                  <CloseIcon
                    className="close_icon"
                    onClick={() => closeModal(dispatch)()}
                  />
                </div>
                <p className="link_word">
                  Enter your email link, we will senf you the recovery link
                </p>

                <div className="input">
                  <div className="email-input">
                    <span>Email</span>
                    <br />
                    <div className="email-part">
                      <input
                        type="text"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                      />
                    </div>
                  </div>

                  <div className="signin-buttom_forget">
                    <button onClick={() => setShowsentemail(true)}>
                      Update password
                    </button>
                  </div>
                </div>
                <div className="buttom"></div>
              </div>
            </>
          ) : (
            <>
              <div className="container_forget" style={divStyle}>
                <div className="title">
                  <h2>no</h2>
                  <CloseIcon
                    className="close_icon"
                    onClick={() => closeModal(dispatch)()}
                  />
                </div>
                <p className="link_word">
                  Enter your email link, we will senf you the recovery link
                </p>

                <div className="input">
                  <div className="email-input">
                    <span>Email</span>
                    <br />
                    <div className="email-part">
                      <input
                        type="text"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                      />
                    </div>
                  </div>

                  <div className="signin-buttom_forget">
                    <button onClick={signup}>Update password</button>
                  </div>
                </div>
                <div className="buttom"></div>
              </div>
            </>
          )}
        </>
      ) : (
        <div className="container" style={divStyle}>
          <div className="title">
            <h2>{Title}</h2>
            <CloseIcon
              className="close_icon"
              onClick={() => closeModal(dispatch)()}
            />
          </div>

          <div className="input">
            <div className="email-input">
              <span>Email</span>
              <br />
              <div className="email-part">
                <input
                  type="text"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                />
              </div>
            </div>
            <div className="password-input">
              <span>Password</span>
              <br />
              <div className="password-part">
                <input
                  type={show ? "text" : "password"}
                  value={psw}
                  onChange={(e) => setPsw(e.target.value)}
                />
                {!Signup_close ? <span onClick={showpsw}>Show</span> : <></>}
              </div>
              <div className="warning">
                <span style={warningStyle}>Wrong format!</span>
              </div>
            </div>
            {!Signup_close ? (
              <>
                <div className="signin-buttom">
                  <button onClick={signin}>Sign in</button>
                </div>
              </>
            ) : (
              <div className="signin-buttom">
                <button onClick={signup}>Create account</button>
              </div>
            )}
          </div>
          <div className="buttom">
            <div className="left">
              {!Signup_close ? (
                <>
                  <span>Don't have an account?</span>
                  <a onClick={() => signupModal(dispatch)()}>Sign up</a>
                </>
              ) : (
                <>
                  <span>Already have an account</span>
                  <a onClick={() => signupModal(dispatch)()}>Sign in</a>
                </>
              )}
            </div>
            {!Signup_close ? (
              <div className="rightpart">
                <a onClick={() => setShowForget(true)}>Forgot password?</a>
              </div>
            ) : (
              <></>
            )}
          </div>
        </div>
      )}
    </>
  );
}
